import React, { component } from 'react';
import { Component } from 'react';

// 標準寫法，除了 App 可能不一樣，其他都差不多一樣
// Class component 類別元件
class App extends Component{
    constructor(){
        this.msg = 'Hello World';
    }
    render(){
        return (
            <div>{ this.msg }</div>
        )
    }
}

export default App;
